import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import StockComp from './StockComp.js'

class DisplayList extends React.Component {

    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                {this.props.list.map(item => 
                <li key={item.name}> {item.name} ~ ${item.stockPrice} ~ {item.sector} ~ {item.perform}% </li>)}
                <StockComp item/>
            </div>
        )
    }
}

export default DisplayList;
